import React from 'react';
import { Button } from './components/Button/button.component';

function App() {
  return (
    <div className="App">

        <Button href='https://storybook.js.org' buttonType='secondary' isFullWidth={true}>Click ME</Button>

    </div>
  );
}

export default App;
